import {faCheck, faEye, faEyeSlash, faUserCircle} from "@fortawesome/free-solid-svg-icons";
import {faFacebookF, faGooglePlusG, faLinkedinIn, faTwitter} from "@fortawesome/free-brands-svg-icons";

export class AuthIcon {
  userCircleIcon = faUserCircle;
  showPassword = false;
  eyeIcon = faEye;
  slashIcon = faEyeSlash;
  googleIcon =  faGooglePlusG;
  facebookIcon = faFacebookF;
  twitterIcon = faTwitter;
  linkedInIcon = faLinkedinIn;
  iconCheck = faCheck;
}
